import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import WebFont from 'webfontloader';

useEffect(() => {
  WebFont.load({
    google: {
      families: ['Source Sans Pro']
    }
  });
 }, []);


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
